import Box from '@mui/material/Box';
import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
// import { commandOptions } from 'redis';



export default function AppDummy({

    userUrl,
    counter,
    header1,
    header2,
    updatedValue,
    urlData,

  }) { 



    return <> 
<Box style={{paddingLeft:'800px'}}>
<textarea  cols="50"
                rows="20" value={JSON.stringify(urlData, null, 2) }></textarea>

<textarea  value={JSON.stringify(urlData.url, null, 2) }></textarea>


<TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Top ping sites</TableCell>
            <TableCell align="right">Url's</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>
          {urlData.map((row) => (
            <TableRow
              key={row}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
            'alo'
              </TableCell>
              <TableCell align="right">{row}</TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>





    </Box>
          </>

}
